import React from 'react';


const Popovers = React.lazy(() => import('./SinhVien_views/Base/Popovers'));
const ProgressBar = React.lazy(() => import('./SinhVien_views/Base/ProgressBar'));
const Switches = React.lazy(() => import('./SinhVien_views/Base/Switches'));
const Tables = React.lazy(() => import('./SinhVien_views/Base/Tables'));
const Tabs = React.lazy(() => import('./SinhVien_views/Base/Tabs'));
const Tooltips = React.lazy(() => import('./SinhVien_views/Base/Tooltips'));


// https://github.com/ReactTraining/react-router/tree/master/packages/react-router-config

const routes = [

  { path: '/SinhVien/ThongTinCaNhan', name: 'Thông Tin Cá Nhân', component: Switches },
  { path: '/SinhVien/LichHoc', name: 'Lịch Học', component: Tables },
  { path: '/SinhVien/TinhTrangHocPhan', name: 'Tình Trạng Học Phần', component: Tabs },
  { path: '/SinhVien/Thi', name: 'Thi', component: Popovers },
  { path: '/SinhVien/HocPhanDangHoc', name: 'Progress Bar', component: ProgressBar },
  { path: '/SinhVien/Thi', name: 'Tooltips', component: Tooltips },

];

export default routes;
